PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE campaign (
	id INTEGER NOT NULL, 
	name VARCHAR(128), 
	description VARCHAR(1024), 
	id_audience INTEGER,
	target_minutes INTEGER,
	minutes_talked INTEGER,
	PRIMARY KEY (id)
);

CREATE TABLE respondent (
	id INTEGER NOT NULL, 
	name VARCHAR(128), 
	phone VARCHAR(32), 
	email VARCHAR(64), 
	url VARCHAR(256), 
	nation VARCHAR(128), 
	"group" VARCHAR(128), 
	party VARCHAR(128), 
	license VARCHAR(128), 
	image VARCHAR(64), 
	voting VARCHAR(16), 
	confluence VARCHAR(16), 
	PRIMARY KEY (id)
);


CREATE TABLE audience (
	id INTEGER NOT NULL, 
	name VARCHAR(128), 
	PRIMARY KEY (id)
);
CREATE TABLE audience_respondent (
	id_audience INTEGER, 
	id_respondent INTEGER, 
	FOREIGN KEY(id_audience) REFERENCES audience (id), 
	FOREIGN KEY(id_respondent) REFERENCES respondent (id)
);



CREATE TABLE random_bias (
	id INTEGER NOT NULL, 
	id_audience INTEGER, 
	id_respondent INTEGER, 
	vector_index INTEGER, 
	distribution_value BIGINT, 
	PRIMARY KEY (id)
);




COMMIT;